import React from 'react';
import netflix_poster from '../Images/netflix_poster.jpg';

const Navbar = () => {
  return (
    <div className={`h-screen bg-${netflix_poster} bg-cover bg-center`}>
      <h1>This is my Car</h1>
    </div>
  );
};

export default Navbar;
